  document.body.style = `backgroundColor: ${mode}`;
  console.log(mode);
  return (
  <>
    <Navbar mode = {mode} setMode = {setMode}/>
    <CalcBody mode = {mode} setMode = {setMode}/>
  </>
  );
}


export default App;
